import React from "react";
export default function Navbar(){
    return(
        <nav className="nav">
            <a href="/" className="sitename">
                Elite Love
            </a>
            <ul>
                <li>
                    <a href="/home">HOME</a>
                </li>
            </ul>
        </nav>
    );
}
